                "name": "rap"
            },
            {
                "id": "c9a0678d-0f04-4dff-81d2-db578155d81d",
                "name": "reggae"
            },
            {
                "id": "12a08a00-e731-40c3-ba6f-ffd51b0e85e6",
                "name": "surf-music"
            },
            {
                "id": "7272f575-0291-4540-bd0d-d8bf2d479093",
                "name": "aleatÃ³rias"
            },
            {
                "id": "a6422a0a-d3e2-411c-94f5-01ff95300ac4",
                "name": "rock"
            },
            {
                "id": "1d8bfb82-ecf6-43c2-8f4e-22d6b21db2a9",
                "name": "mpb"
            },
            {
                "id": "1c6c2ce0-6a57-4897-ab4c-e38175386772",
                "name": "doideira-doida"
            }
        ]
    }
    
    render() {
        const playlists = this.state.playlists.map(playlist => {
            return <PlaylistCard
            key={playlist.id}
                onChange={this.props.mudarPagina}
                name={playlist.name}
            />
        })

        return (
            <PlaylistsContainer>
                {playlists}
            </PlaylistsContainer>
        );
    }
}
